import React,{useState, useEffect} from 'react';
import { View,Text,StyleSheet, TouchableOpacity } from 'react-native';

import * as Animatable from 'react-native-animatable';
import { useNavigation } from '@react-navigation/native';


export default function ResultadoTestes() {

  const navigation = useNavigation();

 return (
  <View style={styles.container}>
  
    <Animatable.View  animation="zoomIn" style={styles.title}>
      <Text style={styles.valor}>Parabens por concluir os testes!!!</Text>
    </Animatable.View>
     <Text style={styles.resul}>Resultados</Text>


    <View style={styles.viewResultado}>

    </View>
  
      <Animatable.View animation="zoomIn" style={styles.viewBtn}>
          <View style={styles.viewBtn1e2}>
            <TouchableOpacity style={styles.btn} onPress={() => navigation.navigate('EscolherAluno')}>
              <Text style={styles.btnNum}>Avaliar proximo aluno</Text>
            </TouchableOpacity>

            <TouchableOpacity style={styles.btn} onPress={() => navigation.navigate('PainelControle')}>
              <Text style={styles.btnNum}>Voltar ao inicio</Text>
            </TouchableOpacity>
            
          </View>

      </Animatable.View>

   </View>
  );
}

const styles = StyleSheet.create({
    container:{
        flex: 1,
        backgroundColor:'#38a69d'
    },
    title:{
      flex:1,
      margin:'5%',
      
    },
    valor:{
      fontSize:26,
      fontWeight:'bold',
      textAlign:'center',
      marginBottom:10,
      color:'#fff'
    },
    pergunta:{
      flex:1
    },
    viewBtn:{
      flex:1,
      
      
    },
    viewBtn1e2:{
     marginLeft:'5%',
     marginRight:'5%',
     alignItems:'center'
    },
    viewBtn3e4:{
     
     marginTop:50,
     marginLeft:'5%',
     marginRight:'5%'
    },
    btn:{
     backgroundColor:'#fff',
     width:'100%',
     height:50,
     borderRadius:10,
     marginTop:1,
     alignItems:'center',
     justifyContent:'center',
     marginBottom:10
     
    },
    txt:{
      fontSize:28,
      fontWeight:'bold',
      color:'#fff',
      marginLeft:'5%',
      marginRight:'5%',
      textAlign:'center'
    },
    btnNum:{
      fontSize:25,
      fontWeight:'bold'
    },
    valor1:{
      fontSize:35,
      fontWeight:'bold',
      textAlign:'center',
      marginTop:10
    },
    viewResultado:{
        flex:3,
        backgroundColor:'#fff',
        borderRadius:15,
        margin:'5%',
        marginTop:-1
    },
    resul:{
        fontSize:20,
        color:'#fff',
        fontWeight:'bold',
        fontStyle:'italic',
        marginLeft:'6%',
        marginTop:-25
    }
})
